import React, { Component } from "react";
import Navbar from "./components/Navbar";


class BrowsePage extends Component {
    render() {
        return (
            <div>
            <Navbar />
            <h1>This is the Browsepage</h1>
            </div>
        )
    }
}

export default BrowsePage;
